        const collection = db.collection("ScanDivision");
        console.log(collection);
        const col = ((await collection.find()).slice(0,10));
        console.log(col);
    }
    return ( 
    <div>
                <h1>Administration  Scanup </h1>

        <button onClick={loginAnonymous}>Login</button>
        <Login  setUser={setUser}/>
    </div> )




}

export default Login
